  false,\n\t\"url\": null,\n\t\"notes\": \"The 1997 Sperm Whale Abundance and Population
  Structures (SWAPS) line-transect survey was designed to census sperm whales near
  the end of their breeding season in the North Pacific Ocean from the west coast
  of the continental U.S. out to an area near the Hawaiian Islands. This survey was
  conducted by the NOAA Southwest Fisheries Science Center (SWFSC) aboard the NOAA
  ship McArthur for a total of approximately 12,000 kilometers surveyed from early
  March to early June 1997.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
